script: |
  super -f text -I q11101.spq | sort > q11101.out

inputs:
  - name: q11101.spq
    data: |
      SELECT - col1 + col1 / col1 + cor0.col2 AS col0 FROM tab1 (FORMAT parquet) cor0 WHERE NULL NOT BETWEEN ( + col0 * + col0 ) AND ( col0 + col0 / col2 );
  - name: tab1

outputs:
  - name: q11101.out
    data: |
